INSERT INTO `lifetek_about_us` (`id`, `name`, `content`, `url`) VALUES
(2, 'Giới thiệu công ty', '<p>Xin được&nbsp;gửi lời tr&acirc;n trọng&nbsp;nhất tới Qu&yacute; vị!</p>\n\n<p>&nbsp;Ch&uacute;ng t&ocirc;i vui với niềm vui th&agrave;nh c&ocirc;ng của Qu&yacute; vị, ch&uacute;ng t&ocirc;i lo lắng c&ugrave;ng những lo lắng của Qu&yacute; vị, trước những thử th&aacute;ch. v&igrave; vậy ĐỒNG H&Agrave;NH, CAM KẾT, S&Aacute;NG TẠO, THẤU HIỂU, TẬN TUỴ l&agrave; những đức t&iacute;nh m&agrave; ch&uacute;ng t&ocirc;i coi đ&oacute; l&agrave; gi&aacute; trị cốt l&otilde;i gi&uacute;p ch&uacute;ng t&ocirc;i th&agrave;nh c&ocirc;ng trong h&ocirc;m nay v&agrave; ng&agrave;y mai.</p>\n\n<p>Ch&uacute;ng t&ocirc;i kh&ocirc;ng chỉ dừng lại ở việc cung cấp một sản phẩm, một dịch vụ m&agrave; hơn thế ch&uacute;ng t&ocirc;i cung cấp một giải ph&aacute;p tối ưu đến qu&yacute; vị. Bằng việc kh&ocirc;ng ngừng đổi mới đến sự ho&agrave;n thiện ch&uacute;ng t&ocirc;i sẽ gi&uacute;p qu&yacute; vị c&oacute; những c&ocirc;ng tr&igrave;nh tốt hơn tiết kiệm hơn đẹp hơn.</p>\n\n<p>H&atilde;y tin cậy v&agrave; giao trọng tr&aacute;ch đ&oacute; cho ch&uacute;ng t&ocirc;i.</p>\n\n<p>Ch&uacute;ng t&ocirc;i rất hạnh ph&uacute;c nếu được trở th&agrave;nh đối t&aacute;c của Qu&yacute; vị!</p>\n', 'gioi-thieu-cong-ty'),
(3, 'Chính sách vận chuyển', '<p>Ch&iacute;nh s&aacute;ch vận chuyển</p>\r\n', 'chinh-sach-van-chuyen'),
(4, 'Tuyển dụng', '<p>Tuyển dụng</p>\n', 'tuyen-dung');
