(57, 'Giải thưởng "THƯƠNG HIỆU VÀNG THĂNG LONG"', '<p>C&ocirc;ng ty CP XNK Thương mại v&agrave; ph&acirc;n phối MYS đ&atilde; được vinh danh nhận Giải thưởng &quot;THƯƠNG HIỆU V&Agrave;NG THĂNG LONG&quot;</p>\n', '<p>C&ocirc;ng ty CP XNK Thương mại v&agrave; ph&acirc;n phối MYS đ&atilde; được vinh danh nhận Giải thưởng &quot;THƯƠNG HIỆU V&Agrave;NG THĂNG LONG&quot;</p>\n\n<p><img alt="" src="/uploads/images/Anh01(10).jpg" /></p>\n\n<p><img alt="" src="/uploads/images/Anh02(6).jpg" /></p>\n\n<p><img alt="" src="/uploads/images/Anh03(5).jpg" /></p>\n', 'Koala1.jpg', 'www.mys.vn', '2016-04-03', 'giai-thuong-thuong-hieu-vang-thang-long'),
(63, 'Chương trình "Quà tặng Mùa Xuân"', '<p>Tổng gi&aacute; trị l&ecirc;n đến hơn 50 triệu đồng - Giải thưởng mỗi ng&agrave;y d&agrave;nh cho tất cả c&aacute;c bạn tham gia!</p>\n', '<p><strong>CHƯƠNG TR&Igrave;NH &ldquo;QU&Agrave; TẶNG M&Ugrave;A XU&Acirc;N&rdquo;</strong></p>\n\n<p><strong>Tổng gi&aacute; trị chương tr&igrave;nh </strong><strong>hơn </strong><strong>5</strong><strong>0</strong><strong>.</strong><strong>0</strong><strong>00.000đ </strong><strong>&ndash; ng&agrave;y n&agrave;o cũng c&oacute; qu&agrave; chỉ cần tham gia</strong></p>\n\n<p><strong>C&aacute;ch chơi:&nbsp;</strong><br />\n1. Like v&agrave; Share post n&agrave;y ở chế độ Public<br />\n2. Comment trực tiếp v&agrave;o Chương tr&igrave;nh&rdquo; Qu&agrave; tặng M&ugrave;a Xu&acirc;n&rdquo;, viết cảm nhận của bạn của bạn về MYS v&agrave; 3 số bất kỳ từ 000 &ndash; 999 (comment n&agrave;y sẽ được t&iacute;nh cho đến ng&agrave;y cuối c&ugrave;ng của chương tr&igrave;nh)</p>\n\n<p><strong>Thể lệ:</strong><br />\n- Hạn ch&oacute;t tham gia: 23h59 ng&agrave;y 27/03/2016.</p>\n\n<p>- Chương tr&igrave;nh sẽ c&oacute; giải thưởng Ng&agrave;y, giải thưởng Tuần, giải thưởng Th&aacute;ng v&agrave; giải thưởng Qu&yacute;<br />\n- Người chơi LIKE v&agrave; SHARE post n&agrave;y ở chế độ public v&agrave; comment c&acirc;u trả lời theo đ&uacute;ng luật.</p>\n\n<p>- Mỗi người chỉ được comment duy nhất 1 lần.<br />\n- Comment bị chỉnh sửa (edited) sẽ kh&ocirc;ng được c&ocirc;ng nhận</p>\n\n<p><strong>Quy định chấm giải:</strong></p>\n\n<p>- Kết quả sẽ được c&ocirc;ng bố v&agrave;o l&uacute;c 11h trưa. BTC sẽ quay clip v&agrave; chọn một số ngẫu nhi&ecirc;n bằng website <a href="https://www.random.org/">https://www.random.org/</a>, do đ&oacute; những thay đổi sau thời gian n&agrave;y sẽ kh&ocirc;ng được t&iacute;nh.<br />\n- Bất cứ Account n&agrave;o sử dụng c&aacute;c h&igrave;nh thức gian lận như deactive Fb, l&agrave;m thay đổi comment sau khi kết th&uacute;c game... sẽ được xem l&agrave; phạm quy v&agrave; kh&ocirc;ng được c&ocirc;ng nhận.<br />\n- C&aacute;c Account giả, account kh&ocirc;ng c&oacute; tương t&aacute;c theo đ&aacute;nh gi&aacute; của BTC sẽ bị loại v&agrave; BTC kh&ocirc;ng nhận bất cứ khiếu nại n&agrave;o từ những Account n&agrave;y.<br />\n- Quyết định của MYS l&agrave; quyết định cuối c&ugrave;ng.</p>\n\n<p><br />\n----------------------------------------------------------------------------------------------------------------<br />\n<strong>Giải thưởng: Tổng gi&aacute; trị chương tr&igrave;nh l&ecirc;n đến 51.200.000đ</strong></p>\n\n<p><strong>Giải thưởng Qu&yacute; ( tổng gi&aacute; trị 12.395.000 đ)</strong><br />\n- 01 Nồi &aacute;p suất đa năng S Home trị gi&aacute; 1.720.000đ, 1 Chảo chống d&iacute;nh đa năng S Home trị gi&aacute; 495.000đ/chảo, bộ 3 b&aacute;t sứ B&aacute;t Tr&agrave;ng trị gi&aacute; 180.000đ v&agrave; 1 Voucher giảm gi&aacute; 50% (trị gi&aacute; l&ecirc;n đến 10 triệu) &nbsp;từ gi&aacute; ni&ecirc;m yết &aacute;p dụng cho tất cả c&aacute;c mặt h&agrave;ng cho 1 bạn c&oacute; số tr&ugrave;ng với số m&agrave; website <a href="https://www.random.org/">https://www.random.org/</a> quay được của ng&agrave;y cuối c&ugrave;ng của chương tr&igrave;nh</p>\n\n<p>- Trong trường hợp c&oacute; nhiều bạn tr&ugrave;ng số nhau sẽ chọn người c&oacute; c&acirc;u trả lời đ&uacute;ng sớm hơn.</p>\n\n<p><strong>Giải thưởng Th&aacute;ng (tổng gi&aacute; trị 10.650.000đ)</strong><br />\n- 3 đ&egrave;n chống cận HoangSa trị gi&aacute; 550.000đ/ đ&egrave;n v&agrave; 1 Voucher giảm gi&aacute; 40% (trị gi&aacute; l&ecirc;n đến 3 triệu) từ gi&aacute; ni&ecirc;m yết &aacute;p dụng cho tất cả c&aacute;c mặt h&agrave;ng cho 3 bạn may mắn c&oacute; số tr&ugrave;ng với số m&agrave; website <a href="https://www.random.org/">https://www.random.org/</a> quay được trong video của chương tr&igrave;nh up l&ecirc;n</p>\n\n<p><strong>Giải thưởng Tuần (Thứ 7 của tuần) (tổng gi&aacute; trị 8.090.000đ)</strong></p>\n\n<p>- 6 Th&igrave;a c&aacute;n sứ B&aacute;t Tr&agrave;ng trị gi&aacute; 90.000đ v&agrave; 1 Voucher giảm gi&aacute; 35% (trị gi&aacute; l&ecirc;n đến 2 triệu) từ gi&aacute; ni&ecirc;m yết &aacute;p dụng cho tất cả c&aacute;c mặt h&agrave;ng cho 2 bạn c&oacute; số tr&ugrave;ng với số m&agrave; website <a href="https://www.random.org/">https://www.random.org/</a> quay được hoặc nhỏ hơn gần nhất tiếp theo</p>\n\n<p><strong>Giải thưởng h&agrave;ng Ng&agrave;y (Từ thứ 2 đến thứ 6 &ndash; 5 s&aacute;ch/tuần) (tổng gi&aacute; trị 20.068.000đ)</strong></p>\n\n<p>&nbsp;</p>\n\n<p>- 1 cuốn s&aacute;ch hữu &iacute;ch trị gi&aacute; từ 20.000 đến 68.000đ v&agrave; 1 voucher giảm gi&aacute; 32% (trị gi&aacute; l&ecirc;n đến 1 triệu) từ gi&aacute; ni&ecirc;m yết cho 1 bạn mỗi ng&agrave;y c&oacute; số tr&ugrave;ng với số m&agrave; website <a href="https://www.random.org/">https://www.random.org/</a> quay được hoặc nhỏ hơn gần nhất tiếp theo</p>\n\n<p>-------------------------------------------------------------------------------------------------------------------------------<br />\n<strong>Quy định giải thưởng:</strong><br />\n- Những bạn tr&uacute;ng thưởng sẽ được li&ecirc;n lạc qua email hoặc gọi điện đến để th&ocirc;ng b&aacute;o</p>\n\n<p>- Những bạn tr&uacute;ng thưởng tại khu vực H&agrave; Nội sẽ đến cửa h&agrave;ng tại 75 Vũ Ngọc Phan để nhận giải thưởng<br />\n- Voucher c&oacute; hiệu lực 6 th&aacute;ng &aacute;p dụng cho tất cả c&aacute;c sản phẩm của MYS</p>\n\n<p>- Voucher &aacute;p dụng cho tổng sản phẩm kh&aacute;ch h&agrave;ng đ&atilde; mua theo từng Voucher</p>\n\n<p>- Voucher chỉ c&oacute; thể sử dụng 1 lần duy nhất, &aacute;p dụng cho c&aacute;c sản phẩm tại MYS<br />\n- Voucher kh&ocirc;ng c&oacute; gi&aacute; trị quy đổi th&agrave;nh tiền mặt, kh&ocirc;ng trả lại tiền thừa.<br />\n- Voucher kh&ocirc;ng được &aacute;p dụng k&egrave;m theo c&aacute;c chương tr&igrave;nh khuyến m&atilde;i hiện c&oacute; của sản phẩm tại thời điểm sử dụng voucher.<br />\n- Kh&ocirc;ng &aacute;p dụng cộng dồn gi&aacute; trị c&aacute;c voucher.</p>\n\n<p>- Người tr&uacute;ng giải chỉ được nhận giải thưởng bằng hiện vật, kh&ocirc;ng quy đổi th&agrave;nh tiền mặt.</p>\n\n<p>- Giải thưởng chỉ được trao cho những ứng vi&ecirc;n hợp quy c&aacute;ch: l&agrave; kh&aacute;ch h&agrave;ng đ&atilde; sử dụng sản phẩm của c&ocirc;ng ty</p>\n\n<p><strong>Thời gian:</strong><br />\n- C&ocirc;ng bố người tr&uacute;ng giải Th&aacute;ng v&agrave; Qu&yacute;: Đầu tuần của tuần tiếp theo khi kết th&uacute;c chương t&igrave;nh v&agrave; chương tr&igrave;nh kết th&uacute;c v&agrave;o ng&agrave;y 31/03/2016<br />\n- Thời gian người tr&uacute;ng giải x&aacute;c nhận giải: sẽ được th&ocirc;ng b&aacute;o qua tin nhắn hoặc điện thoại, nếu kh&ocirc;ng li&ecirc;n lạc được trong 3 ng&agrave;y sẽ hủy giải người kh&ocirc;ng x&aacute;c nhận giải.<br />\n- Thời gian trao giải (dự kiến): 5-7 ng&agrave;y t&ugrave;y địa điểm người nhận</p>\n\n<p><strong>H&igrave;nh thức nhận giải:</strong> Người tr&uacute;ng giải x&aacute;c nhận qua tin nhắn hoặc li&ecirc;n hệ với số điện thoại hotline: 0904 586 502 (Mrs. Thảo)<br />\nGiải thưởng sẽ được chuyển về tận nh&agrave; cho tất cả c&aacute;c kh&aacute;ch h&agrave;ng tr&uacute;ng thưởng trong chương tr&igrave;nh &ldquo;Qu&agrave; Tặng M&ugrave;a Xu&acirc;n&rdquo; của c&ocirc;ng ty MYS</p>\n\n<p>C&ugrave;ng tham gia ngay n&agrave;o c&aacute;c bạn ơi !</p>\n\n<p>[Giải thưởng ng&agrave;y] <a href="https://www.facebook.com/CongTy.Mys/videos/1051649564891761/">[1]</a>&nbsp;<a href="https://www.facebook.com/CongTy.Mys/videos/1052273664829351/">[2]</a></p>\n', 'kd.jpg', 'mys.vn', '2016-04-02', 'chuong-trinh-qua-tang-mua-xuan'),
(64, 'Super hot trong hè 2016', '<p>Tada v&agrave; mama socola</p>\n', '<p>C&aacute;c si&ecirc;u phẩm cứ tự nhi&ecirc;n bay đến như mưa d&ugrave; chả ai th&iacute;ch</p>\n\n<p><img alt="" src="/uploads/images/Banner_QC.jpg"  width:800px" /></p>\n\n<p><img alt="" src="/uploads/images/landing page 01.jpg" /><img alt="" src="/uploads/images/Khung02.jpg" /></p>\n', '', 'mys.vn', '2016-04-07', 'super-hot-trong-he-2016'),
